  {
    uint80 roundId = 1;
    int256 answer = 5;
    uint256 startedAt = 1;
    uint256 updatedAt = 1;
    uint80 ansIn = 1;

    return (roundId, answer, startedAt, updatedAt, ansIn);
  }

  /**
   * @notice get data about the latest round. Consumers are encouraged to check
